import './App.css';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LandingPage from './components/landingpage/landingpage';


function App() {
  return (
    <div className="App">

      <Router>
        <Routes>
          <Route path='/' element={<LandingPage></LandingPage>} ></Route>

        </Routes>
      </Router>




    </div>
  );
}

export default App;
